pub enum CompError {
    UnexpectedEOF(String),
    UnexpectedChar(String),
    Overflow(String),
}

pub enum Expression {
    Binary {
        lhs: Box<Expression>,
        symbol: Operator,
        rhs: Box<Expression>,
    },
    Number {
        inner: u64,
    },
    Unary {
        symbol: Operator,
        inner: Box<Expression>,
    },
}
